import React from 'react';

import { AboutDescription } from './about.styles';

const AboutPage = (props) =>{

  return (
    <>
      <h1>About</h1>
      <AboutDescription>Dale Street Studio is a Mixing, Mastering and Production studio aimed at helping independent musicians. Whether getting a track or album ready for release to a myriad of different formats and streaming playback.
      Including helping independent artists with promotion web development needs. With the goal of growing to publishing opportunities to independent artists looking for a hub. As clients start to release and promote a consistent body of work. Leaving them to focus on their music direction, artistic vision and more.</AboutDescription>

      <AboutDescription>As a longtime DJ and musician since 1999, Marcus Norwood, aka DJ Definition (hiphop) and M.D. Norwood (blues), started Dale St. to represent his growing studio.
      Focusing on recording, production and engineering techniques he's learned over the years. With the hope of
      turning the studio into a full fledged tracking studio with high quality solutions and scenic mountain views.</AboutDescription>
      <AboutDescription>In addition, Marcus spent over 10 years in the IT industry as a web developer and more. So Dale Keep an eye out for our artist promotion page to see various projects and clients. I hope to help artists with licensing opportunities and sales as the client list grows.</AboutDescription>
      <AboutDescription>Let me know how you'd like me to help on your project. Contact me today to book my services.</AboutDescription>
      <button onClick={() => props.history.push('/')}>Home</button>
  </>
  )
};




export default React.memo(AboutPage);
